    false,nt"url": null,nt"notes": "Several of the trace metals appear to be
    in relatively high concentrations, but only in some samples. In no case is gross
    contamination evident for any element. This finding is in accord with results of
    a previous study (Ecology and Environment, Inc., 1986). If individual samples are
    considered to be three separate indicators of leaching (or other contaminant problems)
    for a given well, the most suspect of all well pads examined is SRU 2134. Collectively,
    it yielded the highest concentration found for chromium, manganese, nickel, vanadium
    and zinc. Nevertheless, it must be emphasized that when metals are considered separately,
    in no case does there appear to be cause for great concern. Given the relatively
    high concentrations of chromium (and possibly barium) found at the examined wells,
    it may be prudent to conduct additional sampling to determine if these levels are
    due to a slight degree of leaching, or are merely representative of naturally high
    and variable background levels for the area. Prior to additional sampling, your
    staff must submit a study plan to the Regional Contaminants Coordinator to secure
    funding.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
